pragma solidity ^0.4.24;


contract DMCToken {
    // Name
    string public name = "DMC Token";
    string public symbol = "DMC";
    string public standard = "DMC Token v1.0";
    string private error;
    uint256 public totalSupply;

    event Transfer (
        address indexed _from,
        address indexed _to,
        uint256 _value
    );
// DMCToken Built On Ethereum Blockchain (Using web3, truffle) and ganache for testing. 

    event Approval (
        address indexed _owner,
        address indexed _spender,
        uint256 _value
    );

    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;

    constructor (uint256 _initialSupply) public {
        balanceOf[msg.sender] = _initialSupply;
        totalSupply = _initialSupply;
    }

    // Transfer
    function transfer(address _to, uint256 _value) public returns (bool success) {
        // Check if what the users sends is higher then the value that they have. if and else (statement)
        error = "Error Not enough value";
        require(balanceOf[msg.sender] >= _value, error);

        //  Transfer value deducting balance to one account adding it to another
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;

        // Transfer Messages to the value.
        emit Transfer(msg.sender, _to, _value);

        return true;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        // Allowance
        allowance[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender,_value);
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        // Require _from has enough tokens
        error = "Error Not enough value";
        require(_value <= balanceOf[_from], error);
        // Require allowance is big enough
        require(_value <= allowance[_from][msg.sender], error);


        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;

        allowance[_from][msg.sender] -= _value;

        emit Transfer(_from, _to, _value);
        return true;
    }






}
